body:
To test a streaming Job, I launched a marathon job with the follow json:

```
{
  "id": "stat.json-1453453512",
  "instances": 1,
  "cpus": 0.1,
  "mem": 128.0,
  "container": {
    "type": "DOCKER",
    "docker": {
      "image": "path/to/image/s2lambda:stat.json-1453453512",
      "forcePullImage": true
    }
  }
}
```

This job reads data from Kafka, computes that count by `serviceName`, `label`, `operation`, and  `log_type`
then writes the results to Kafka back.

The job works without any problem for 3 days.
